const Moves = (props) => {
    const moves = props.moves.map(move => {
        const version = move.version_group_details.map(v => {
            return (
                <>
                    Level learned At: {v.level_learned_at}
                    <br/>
                    Version: {v.version_group.name}
                </>
            )
        })


        return (
            <div>
                Name: {move.move.name} 
                {version}
            </div>
        )
    })

    return (
        <div>
            {moves}
        </div>
    )
}

export default Moves
